def fibonacci(n):
    if n <= 0:
        return None
    elif n == 1:
        return 1
    elif n == 2:
        return 1
    else:
        fib_1 = 1
        fib_2 = 1
        for i in range(3, n+1):
            fib = fib_1 + fib_2
            fib_1 = fib_2
            fib_2 = fib
        return fib
